    line-height:105%'>Una particularidad que presenta Oceanía es que&nbsp;el 88
    % de su superficie está ocupada por un solo país, Australia. Los 13 países
    restantes que conforman el continente y los 15 territorios coloniales se
    distribuyen en el 12 % restante de superficie.<o:p></o:p></span></p>
